export default class ScheduleViewer extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            schedule: props.schedule
        };
    }

    render() {
        return (
            <>
                <p>
                    Schedule
                </p>
            </>
        );
    }
}
